:text: "AN ANCIENT TAONGA\nThe hei-tiki, Nga Kahurangi o Nga Rangi Wairua is presently
  in the possession\nof a descendant of Henry Williams and is being held at Te Papa
  Tongarewa pending\na decision on its future. The following information on its history
  and significance\nhas been supplied by Rawiri Te Puru Terehou (David Simmons).\nFilii,\nKo
  Nga Kahurangi o Nga Rangi Wairua te hei-tiki, ko te kaitiaki o\nmua ko Piriama,
  he rangatira no Ngai Tahu o te Waipounamu me no\nTe Atiawa no Taranaki, kei te tauihu
  o te Waka a Maui ra. He mea I\nhanga mo tera rangatira in nga wa o mua. Ko tana
  mokopuna ko Noa\nHuke he ariki nui no Ngati Kahungunu, no Ngati Maniapoto me etahi\natu
  iwi o Aotearoa nei. Ko te mana o te tiki I hoatu ki a Henry Williams,\nhe whakapumau
  no ia te mana kia korero kia tu ai i runga i nga marae\nkatoa o nga iwi, me kia
  maru ai tana whanau. Te koha te mana.\nHeimili -\ntesi\nlintasiNews\ntriasieger\nEvrimin\nDreiftet,\necuali\niz.11ain
  Nga Kahurangi oNga Rangi Wairua (The Treasure of the Spiritual\nHeavens) is the
  hei-tiki whose guardian in ancient times was Piriama,\na chief of Ngai Tahi of the
  South Island and Te Ati Awa of Taranaki\nwho belonged to the prow of Maui's canoe
  (Northern South Island).\nIt was originally made for him in ancient times. His grandson
  was\nNoa Huke of Ngati Kahungunu, Ngati Manapoto and other tribes of\nNew Zealand.
  He gave a gift of the mana associated with the tiki to\nHenry Williams to give him
  the right to stand on all the marae of the\ntribes and speak and to safeguard his
  family. The gift was the mana.\nWalli\nfari tie!\nleft\n(Nga Kahurangi o nga Rangi
  Wairua was the visible symbol that\nthe blood of Piriama runs in the veins of his
  descendants. It has gathered\nmuch mana from each of the individuals who have held
  it since it was made some\neight or nine generations ago. It cannot be owned but
  is held by its kaitiaki or\nguardian).\nTe Tohu tenei a Rawiri Te Puru Terehou,\nKaitiaki
  o te Whare Taonga Ko Huiarau.\n20 o Haratua 1997\n\"...\". *Spie-breate\nCinara
